'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/posts/the_adventure_thus_far/','title':"The Adventure Thus Far...",'section':"Posts",'content':"Need to put some info here.\n"});index.add({'id':3,'href':'/docs/gold_ledger/','title':"Gold Ledger",'section':"Docs",'content':"Gold Ledger (as of 7/28/2020)\r#\r\rTotal Balance:\r#\r\r 5740gp 3sp  Balance Breakdown:\r#\r\r   Copper Silver Electrum Gold Platinum     2600 10343 0 3280 140    In/Out Ledger\r#\r\r   Amount Date Description     + 200gp 7/12/2020 Ingo Boat Job Initial Payment   - 150gp 7/12/2020 Spell Scrolls from Iaz Captain   + 100gp 7/12/2020 Initial payment from Manistrat Copperlocks   + 900cp 6/14/2020 Removing all coin from Secret Room in Mines   + 9000sp 6/14/2020 Removing all coin from Secret Room in Mines   + 1900gp 6/14/2020 Removing all coin from Secret Room in Mines   + 140pp 6/14/2020 Removing all coin from Secret Room in Mines   - 50gp 6/14/2020 Marinier\u0026rsquo;s Guild Membership   + 500gp 5/17/2020 Hard Wood Job   + 1700cp 5/17/2020 Bollywog Village   + 700sp 5/17/2020 Bollywog Village   + 100gp 5/17/2020 Bollywog Village   - 70gp 5/17/2020 Map of Marshes and Antivenom   + 500gp 4/26/2020 Selling Random Exotic Goods   - 500gp 4/26/2020 Aquiring Random Exotic Goods for Resale   - 120gp 4/26/2020 Stocking ship with 20 days of ship rations   - 10gp 4/26/2020 Shield and Dagger for Varanus   + 700gp 1/12/2020 Lizardfolk Recon   - 2250gp 1/12/2020 Half Plate for Telinax and Plate for Kholos   - 100gp 1/12/2020 and 6 ingots to Winston   + 1200gp 1/12/2020 Trading Ingots for Plate and Half Plate   + 900gp 1/12/2020 6 Ingots to Winston   + 500gp 1/12/2020 Reward for Killing Smugglers   + 276gp 1/12/2020 Vendored Goods from Ship   + 500sp 12/22/2019 First Mate Money   + 50gp 12/22/2019 From Wizards Quarters on Ship   + 200gp 12/22/19 From Town Council for Returning Stolen Goods         "});index.add({'id':4,'href':'/docs/items/','title':"Items",'section':"Docs",'content':"Initial Document.\n"});index.add({'id':5,'href':'/docs/npcs/','title':"NPCs",'section':"Docs",'content':"NPC Notes\r#\r\rSaltmarsh NPCs\r#\r\rEliander\r#\r\r A member of the Saltmarsh town council. A \u0026ldquo;Kingsman\u0026rdquo; \u0026ndash; sent to Saltmarsh to attempt to bring it more under the King\u0026rsquo;s control. Talks very slowly and deliberately  Skeeziks\r#\r\r"});index.add({'id':6,'href':'/docs/places/','title':"Places",'section':"Docs",'content':"Saltmarsh\r#\r\r\rPlaces\r#\r\r1. City Gate\r#\r\r2. Barracks and Jail\r#\r\r Kraddok Stonehorn is the lead jailor. Volunteer Force  3. Greybards\u0026rsquo;\r#\r\r Old tavern for old people.  4. Eliander\u0026rsquo;s Home\r#\r\r King\u0026rsquo;s Man. Sent to get Saltmarsh more integrated into the Keoland Kingdom. Has a large library.  5. Mining Company Headquarters\r#\r\r In-town Headquarters for Manistrat Copperlock\u0026rsquo;s mining company.  6. Wizard\u0026rsquo;s (Keledek) Tower\r#\r\r Doesn\u0026rsquo;t seem very nice. Home to Keledek the Unspoken (male human)  7. Faithful Quartermasters of Iuz\r#\r\r Sells random magic goods Run by Captain Xendros (Lizardfolk Female)  8. Princess of the Bouncing Bounties\r#\r\r Dancing girls \u0026ndash; but not danging lizardfolk girls, eww.  9. Green Market\r#\r\r Good place to buy anything but fish, nautical wares or salt. Open Daily  10. Sharkfin Bridge\r#\r\r Lardge bridge lined with homes and shops (on the bridge)  11. Kester\u0026rsquo;s Leather Goods\r#\r\r12. Hoolwater Tower\r#\r\r Guard watch tower If Eliander is home or are the council, he\u0026rsquo;s likely here.  13. The Snapping Line\r#\r\r Lobster Specials! Run by Hanna Rist (Human Female)  14. Council Hall\r#\r\r15. Weekly Market\r#\r\r Open once per week with extra merchants.  16. Gellan Primewater Mansion\r#\r\r Home to the old human council member dude.  17. The Dwarven Anvil\r#\r\r Run by Mafera and her son Jasker  18. Fishmonger Plant\r#\r\r19. Eda Oweland House\r#\r\r Home to Eda, the old female human council member lady. Head of the town council.  20. Anders Solmor House\r#\r\r Anders and Skerrin live here.  21. Mariners\u0026rsquo; Guildhall\r#\r\r22. Ingo the Drover\u0026rsquo;s House\r#\r\r23. Carpenters\u0026rsquo; Guildhall\r#\r\r Guildmaster likes rare wood. Jilar Kankleston (female gnome) is the Guildmaster.  24. Crabber\u0026rsquo;s Cove\r#\r\r Warned to stay away from the abandoned buildings.  25. The Leap\r#\r\r26. Temple of Speorcga\r#\r\r Kholos prays here. Run by Wellgar Brinehanded (Human Male)  27. Saltmarsh Cemetery\r#\r\r Run by Krag (innkeeper). Borrowed his spyglass once.  28. Winston\u0026rsquo;s Store\r#\r\r Winston is a halfling male.  29. Sea Grove of Obad-Hai\r#\r\r Druid Grove connected to elves. Oceanus mentioned to us.  30. Standing Stones.\r#\r\r"});index.add({'id':7,'href':'/docs/player_characters/','title':"Player Controlled Characters",'section':"Docs",'content':"Initial Page\n"});})();